import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import * as serviceWorker from './serviceWorker';
import createReactClass from 'create-react-class';

const buttonStyle = {
  borderRadius:5,
  fontSize:15,
  borderTop:0,
  borderLeft:0,
  borderRight:0,
  height:40,
  width: 90,
  marginLeft: 180,
  color:"white",
  backgroundColor:"coral"
};

var Subpage = createReactClass({
  pageName: "",
  pageUrl: "",
  redirect: false,
  goToPage: function(){
    switch (this.pageName) {
      case "Healthcare Provider":
        this.pageUrl = window.location.href + "healthcareProvider";
      case "Insurance Provider":
        this.pageUrl = window.location.href + "insuranceProvider";
      case "Issuer":
        this.pageUrl = window.location.href + "issuer";
      case "Patient":
        this.pageUrl = window.location.href + "patient";
        break;
      default:
        this.pageUrl = window.location.href;
    }
    this.redirect = true;
  },
  render: function(){
    if (this.redirect) {
      return <Redirect push to={this.pageUrl} />;
    }
    return(
      <div>
        <button style={buttonStyle}
                onClick={this.goToPage}>{this.pageName}</button>
      </div>
    );
  }
});

function MainPage() {
  return (
    <div className="App">
        <div className="App-header">
          <img src={"https://cert.ccsemc.com/filing/images/UL_Logo.gif"} className="App-logo" alt="logo" />
          <h2 className="headerFont">Healthcare Identity Management System Prototype</h2>
          <h2 className="headerFont">Please Select Your Identity: </h2>
        </div>
        <div className = "App-body">
          <Subpage pageName = "healthcareProvider"/>
        </div>
      </div>
  );
}

ReactDOM.render(<MainPage />, document.getElementById('root'));

serviceWorker.unregister();
